import React from 'react';
import LinkButton from '../items/LinkButton';

function Error() {
    return (
        <div className="error">
            <h1>That URL doesn't look right.</h1>
            <p>Want to head back home?</p>
            <LinkButton url="/" label="Back to Home"></LinkButton>
        </div>
    )
}

export default Error
